syntax = "proto3";
package proto;
import "Request.proto";
import "Response.proto";

option java_package = "net.iGap.proto";
option java_outer_classname = "ProtoUserSessionTerminate";

message UserSessionTerminate {
    Request request = 1;
    uint64 session_id = 2;
}

message UserSessionTerminateResponse {
    Response response = 1;
}